import React from 'react'
import ReactDOM from 'react-dom'

function generateChecks() {

    if (sessionStorage.getItem("checkboxcheck")) {
        let checklist = sessionStorage.getItem("checkboxcheck")
        for (let i = 0; i < document.querySelectorAll('.check').length; i++) {
            if (checklist == document.querySelectorAll('.check')[i].textContent) {
                document.querySelectorAll('.checkbox')[i].checked = true
            }
        }
        typeAmount =[]
        if (typeof(document.querySelectorAll('.checkbox:checked')[0]) != 'undefined') {
            for (let i = 0; i < document.querySelectorAll('.checkbox:checked').length; i++) {
                submitParameters = document.querySelectorAll('.checkbox:checked')[i].value
                typeAmount.push(submitParameters)
            }
        } 
        createProjects()

        document.getElementById('main-title').textContent = checklist
        document.getElementById('title-img').src = "../img/place.png"

    }


}







export default generateChecks
